import React, {useEffect} from "react";
import TaskCreateInputContainer from "../components/TaskCreateInput/TaskCreateInputContainer";
import TasksListContainer from "../components/TasksList/TasksListContainer";
import {createTaskThunk, getTasksThunk} from "../store/createTaskReducer";
import {connect} from "react-redux";

const Home = ({getTasksThunk,createTaskThunk}) => {
    useEffect(() => {
        getTasksThunk()
    },[])
    return(
        <div>
            <button onClick={() => createTaskThunk(4,'test')}>CREATE</button>
            <button onClick={() => getTasksThunk()}>GET</button>
            <TaskCreateInputContainer/>
            <TasksListContainer/>
        </div>
    )
}

export default connect(null,{getTasksThunk,createTaskThunk})(Home)
